import React from 'react';
import { 
  DeliveryDateComponent, 
  DeliveryLogoComponent,
  DeliveryText
 } from './delivery-date.styles';

const DeliveryDate = () => {
  return (
    <DeliveryDateComponent>
      <DeliveryLogoComponent/>
      <DeliveryText>
        Buy now and get it by
      </DeliveryText>
    </DeliveryDateComponent>
  )
}

export default DeliveryDate;
